script: |
  super -f text -I q530.spq | sort > q530.out

inputs:
  - name: q530.spq
    data: |
      SELECT DISTINCT + 23 AS col0 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q530.out
    data: |
      23
